import React, { Component } from "react";
import Question from './Question'
import "./Questions.css";

class Questions extends Component {

  constructor(props) {
    super(props);
  }

  render() {
    const questions = [
      "Can I use Purell/hand sanitizer?", 
      "How long do I wash my hands for?",
      "How long do I keep the band-aid for?",
      "Unanswerable"
    ];

    return (
      <div className="questions mt-5">
        <h2>Questions</h2>
        <hr/>
        {questions.map((question, i) => 
            <Question key={i} data_index={i+1} question={question}></Question>
        )}

<div class="container">
  <div class="row">
    <div class="col text-center">
      <button class="btn btn-default">Centered button</button>
    </div>
  </div>
</div>
        <div className="container">
          <div>
            <div>

            </div>
          </div>
          <button type="button" className="btn mt-3 btn-dark btn-lg">Reply</button>
          <button type="button" className="btn mt-3 btn-dark btn-lg">Repeat</button>
          <button type="button" className="btn mt-3 btn-dark btn-lg">Done</button>
        </div>
      </div>
    );
  }
}

export default Questions;
